interface User{
  id:number,
  firstName:string,
  lastName:string,
  age:number,
  gender:string,
  email:string
}

const page = async() => {
const res = await fetch('https://dummyjson.com/users');
  const data = await res.json();
  const todos:User[] = data.users;
  return (
    <div>
      <ul>
        {todos.map((t) => (
          <li key={t.id}>
            {t.todo} - {t.completed ? 'Completed' : 'Not Completed'}
          </li>
        ))}
      </ul>
    </div>
  )
}

export default page
